sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gcp_cds_spoke.fetch_indexes', {
        "project_id": inputs.projectid,
        "filter": inputs.filter
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var indexes = [];
    obj.forEach(function(indexObj) {
        indexes.push({
            "label": indexObj.indexId,
            "name": indexObj.indexId
        });
    })
    outputs.indexes = {
        data: indexes
    }
})(inputs, outputs);

